import { Component, Input} from '@angular/core';

@Component({
  selector: 'app-list-skills',
  templateUrl: './list-skills.component.html',
  styleUrls: ['./list-skills.component.scss']
})
export class ListSkillsComponent {
  @Input() title:string = "Liste de mes compétences"
}

<section class="jumbotron text-center">
  <div class="container">
    <br />
    <h1 class="jumbotron-heading">{{title}}</h1>

  </div>
</section>

<div class="list-group">
  <a href="/link" class="list-group-item list-group-item-action">GESTION DE PROJET</a>
  <a href="#" class="list-group-item list-group-item-action">TECHNOLOGIES BACK-END</a>
  <a href="#" class="list-group-item list-group-item-action">TECHNOLOGIES FRONT-END</a>
  <a href="#" class="list-group-item list-group-item-action disabled">SAVOIR ETRE</a>
</div>
